import Navbar from "../../Components/navbar/Navbar";
import Header from "../../Components/header/Header";
import Slider from "../../Components/slider/Slider";

export default function Home() {
    let headerProps = {
        // LeftArrow || noAction
        action: "noAction",
        subheader: "active",
        text: "World's News"
    }
    let sliderProps = {
        title: "Scientists identify the most extreme heatwa..",
        subtitle: "2 hours ago",
        subtitleIconState: false,
        HighlightState: false,
        HighlightText: "CLIMATE CHANGE",
        img: [
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            },
            {
                src: "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
            }
        ]
    }

    return (
        <div>
            <Header action = {headerProps.action} text = {headerProps.text}
                    subheader = {headerProps.subheader} />

            <Slider title = {sliderProps.title}
                    subtitle = {sliderProps.subtitle}
                    sliderimg = {sliderProps.img}
                    highLightState = {sliderProps.HighlightState = true}
                    highLighttText = {sliderProps.HighlightText}
                    subtitleIconState = {sliderProps.subtitleIconState} />

            <Header action = {headerProps.action} text = {headerProps.text = "What's the Impact?"}
                    subheader = {headerProps.subheader = "hidden"} />

            <Navbar />

            <Slider title = {sliderProps.title = "The LIV estimates that 40% of countries are in 'water stress zones.'"}
                    subtitle = {sliderProps.subtitle}
                    sliderImg = {sliderProps.img}
                    highLightState = {sliderProps.HighlightState = false}
                    subtitleIconState = {sliderProps.subtitleIconState=true} />
        </div>
    )
}
